import Container from '@material-ui/core/Container';

const App = props => {
	return (
		<>
			<Grid container direction='row-reverse' className='header'>
				<Grid item className='show' xs={4}>
					تیزتایپ
				</Grid>
				<Grid item className='show' xs={4} />
				<Grid item className='show' xs={4}>
					خانه
				</Grid>
			</Grid>
		</>
	);
};

export default App;
